// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

contract Constants {
    // konvensi pengkodean untuk variabel constant menggunakan huruf besar
    address public constant MY_ADDRESS = 0x3309F5e85593006CCEe362a0AA23e84c00CDeb5b;
    uint public constant MY_UINT = 69;
}


// constant adalah variabel yang tidak dapat dimodifikasi.

// Nilainya sudah dikodekan dengan baik dan menggunakan constant dapat menghemat biaya gas.

